query:
/*+ NoNestLoop(t ci) NoHashJoin(ci t mi) */ select count(*)
from title AS t
inner join cast_info AS ci
on t.id = ci.movie_id AND t.kind_id = 7 AND t.production_year > 1948 AND ci.person_id < 2036425 AND ci.role_id < 4
inner join movie_info AS mi
on t.id = mi.movie_id AND mi.info_type_id < 2;
